import './App.css';
import Particles from 'react-particles-js';


const ParticlesOptions={
            		particles: {
            			number:{
            				value:30,
            			density:{
            				enable:true,
            				value_area:800

            				}
            			}
            		}
            	}

class App extends Components {
  render(){
  return (
    <div className="App">
      <Particles className='particles'
              params={ParticlesOptions}

            />
      <Navigation />
      <Logo />
      <Rank/>
      <ImageLinkForm />

      {/* 


      <FaceRecognition />*/}
    </div>
  );
}
}

export default App;
